import React from "react";
import FormStyled from "./FormStyled";
import { useState, useEffect } from "react";
import axios from "axios";

const Form: React.FC = () => {
  const timeElapsed = Date.now();
  const today = new Date(timeElapsed);
  const hoje = today.toLocaleDateString();

  const [showElement, setShowElement] = useState(true);
  const showOrHide = () => setShowElement(!showElement);

  const [showElement2, setShowElement2] = useState(true);
  const showOrHide2 = () => setShowElement2(!showElement2);

  const [nome, setNome] = useState<string>();
  const [sobrenome, setSobrenome] = useState<string>();
  const [id, setId] = useState<string>();
  const [telefone, setTelefone] = useState<string>();
  const [setor, setSetor] = useState<string>();
  const [email, setEmail] = useState<string>();
  const [foto, setFoto] = useState(null);

  useEffect(() => {
    let usuario = localStorage.getItem("usuario-logado");
    axios
      .post("http://localhost:3001/getUser", { usuario: usuario })
      .then((response) => {
        setNome(response.data.nome);
        setSobrenome(response.data.sobrenome);
        setId(response.data.id);
        setTelefone(response.data.telefone);
        setSetor(response.data.setor);
        setEmail(response.data.email);
        setFoto(response.data.foto_perfil);
      });
  }, []);

  function criar(e: any) {
    e.preventDefault();
    axios
      .post("http://localhost:3001/createCRM", {
        id: req.body.id,
        versao_crm: req.body.versao_crm,
        colaborador_setor: req.body.colaborador_setor,
        colaborador_id: req.body.colaborador_id,
        descricao: req.body.descricao,
        necessidade: req.body.necessidade,
        impacto: req.body.impacto,
        objetivo: req.body.objetivo,
        justificativa: req.body.justificativa,
        alternativas: req.body.alternativas,
        data_obrigatoriedade: req.body.data_obrigatoriedade,
        complexidade: req.body.complexidade,
        comportamento_offline: req.body.comportamento_offline,
        dependencia_outro_crm: req.body.dependencia_outro_crm,
        numero_crm_dependencia: req.body.numero_crm_dependencia,
        documento_anexo: req.body.documento_anexo,
        data_inicio: req.body.data_inicio,
      })
      .then((response) => {
        alert(response.data);
      });
  }

  return (
    <FormStyled>
      <section>
        <div className="div-form mt-4">
          <div className="posicao-form">
            <form action="">
              <h1>Número de cadastro da CRM: 01245</h1>
              <h3>Responsável:</h3>
              <div className="div-usuario">
                <div className="foto-usuario"></div>
                <p className="texto-usuario">
                  Nome: {nome! + " " + sobrenome!}
                  <br />
                  Matrícula: {id}
                  <br />
                  Setor: {setor}
                  <br />
                  Telefone: {telefone}
                  <br />
                  E-mail: {email}
                </p>
              </div>
              <label htmlFor="participantes">Setores participantes:</label>
              <br />
              <input
                type="search"
                name="participantes"
                id=""
                className="input-participantes"
              />
              <div className="d-flex">
                <div className="div-setor d-flex align-items-center">
                  TI
                  <button className="botao-x" disabled>
                    <i className="fa-solid fa-times-circle" />
                  </button>
                </div>
                {showElement ? (
                  <div className="div-setor ms-2 d-flex align-items-center">
                    Contabilidade
                    <button className="botao-x" onClick={showOrHide}>
                      <i className="fa-solid fa-times-circle" />
                    </button>
                  </div>
                ) : null}
                {showElement2 ? (
                  <div className="div-setor ms-2 d-flex align-items-center">
                    Lorem
                    <button className="botao-x" onClick={showOrHide2}>
                      <i className="fa-solid fa-times-circle" />
                    </button>
                  </div>
                ) : null}
              </div>
              <label htmlFor="descricao" className="pt-3">
                Descrição:
              </label>
              <input
                type="text"
                name="descricao"
                id=""
                className="input-descricao"
              />
              <label htmlFor="objetivo">Objetivo:</label>
              <input
                type="text"
                name="objetivo"
                id=""
                className="input-objetivo"
              />
              <label htmlFor="justificativa">Justificativa:</label>
              <input
                type="text"
                name="justificativa"
                id=""
                className="input-justificativa"
              />
              <div className="div-versao-data">
                <div className="div-usuario">
                  <p>Versão:</p>
                  <p className="ps-2">v1</p>
                </div>
                <div className="div-usuario">
                  <p>Data criação:</p>
                  <p className="ps-2">{hoje}</p>
                </div>
              </div>
              <label htmlFor="documentos">Documentos:</label>
              <input
                type="text"
                name="documentos"
                id=""
                className="input-documentos"
              />
              <br />
              <button type="button" className="botao-anexar">
                <i className="fa-solid fa-upload"></i>
                Anexar documentos
              </button>
              <div className="div-salvar">
                <button type="submit" className="botao-salvar">
                  SALVAR
                </button>
              </div>
            </form>
          </div>
        </div>
      </section>
    </FormStyled>
  );
};

export default Form;
